import { createTheme } from '@mui/material/styles';

const theme = createTheme({
    palette: {
      background: {
        default: '#d6ecd1',
      },
    },
    typography: {
      fontFamily: 'Mali, cursive', // Cambia esto a la fuente que desees
    },
  });

export default theme;
